import '../../App.css';

function Home() {
    return(
        <div className="home">
            <h1>Home</h1>
            <div style="padding:56.25% 0 0 0;position:relative;"><iframe src="https://player.vimeo.com/video/701894737?h=3f997c11b4&amp;badge=0&amp;autopause=0&amp;player_id=0&amp;app_id=58479" frameborder="0" allow="autoplay; fullscreen; picture-in-picture" allowfullscreen style="position:absolute;top:0;left:0;width:100%;height:100%;" title="Test Broadcast"></iframe></div><script src="https://player.vimeo.com/api/player.js"></script>
        </div>
    );
}

export default Home;
